import React from 'react'

function contactsSidebar() {
  return (
    <aside>
      <a href="mailto:youremailaddress">Email Me</a>
      <a href="tel:+5555555555">555 555 5555</a>
      <p>Mon - Fri: 9 - 5, Sat 9 - 2</p>
    </aside>
  )
}

export default contactsSidebar
